INSERT INTO cups VALUES(0,NULL,NULL,NULL,NULL,replace('Across & Elasto Mania World Cups Database\n-----------------------------------------\n\nThis database contains data from the Across and Elasto Mania World Cups. The original data for all early World Cups exists in text files. This database serves as a temporary repository for the World Cup data in a structured format.\n\nAbout the database:\n\n* This informational text for this database is stored in the cups table with the cup value set to 0.\n\n* The player standings have been inserted into the records table as the event number 999. Team standings as event 998 and country standings as 997. \n\n* Many "hardcoded" URLs have been added to the database that may not be working later when things change elsewhere.\n\n* The structure of the database may benefit from some improvements. For instance, while the cup+event combination in the events table should be unique, there''s currently no unique index to enforce this constraint. Adding a unique index for this combination and creating a composite foreign key in the records table to reference it could enhance data integrity. Your input on how to enhance or modify the database structure would be appreciated!\n\n* A users table was added post facto and is not part of the original data. The function of the users table is to make it easier to query records based on users. The users table is a work-in-progress. \n\n* The data was compiled and added with the help of many scripts, particularly for the records data, which involved a combination of scripted automation and manual input. There may be errors, please let me know about them. Also some information is missing because the information has not been found. If you have some information that is missing, let''s add them. There are also some available information missing, like for example in the events table there are killers and apples columns where the data has not been added. This can be easily added, but it requires considerable effort and this information is already available on elma.online so it hasn''t been added at least for now.  \n\n\nSQL query tips and some examples\n-------------------------------------\n\n* Show this information text\n\nselect information from cups where cup = 0;\n\n* Show results of a single event\n\nselect * from records where cup = 4 and event = 17;\n\n* To find records of a user can be achieved in many ways. If you don''t know the users id (or user_id), you could search their name from the records table. Search anything that has the string "magicman" (case-insensitive) in them by:\n\nSELECT * FROM records WHERE nick LIKE ''%magicman%'';\n\n  Take note of the value on user_id column, and then you can search records with the user_id. This is useful if they have had other names in previous World Cups.\n\nSELECT * FROM records WHERE user_id = 8;\n\n  On the other hand, if you know the nickname a user has on users table, this is usually the most recent nickname, or the nickname the user is most well known, you can get all their records with this kind of query:\n\nSELECT r.* FROM records r JOIN users u ON r.user_id = u.id WHERE u.standard_nick LIKE ''%magicman%'';\n\n* Time stamps (columns startDate and endDate in the cups and events tables) use the Unix time stamp format. To display them in a human-readable format, instead of calling endDate or startDate, we would replace them, for example, with `strftime(''%Y-%m-%d %H:%M:%S'', startDate, ''unixepoch'', ''localtime'') AS start_date_local` or `strftime(''%Y-%m-%d %H:%M:%S'', endDate, ''unixepoch'', ''localtime'') AS end_date_local`. \n\n  For example, to show the event, time stamps, and sources columns from World Cup 1, you could query with:\n\n  SELECT event, strftime(''%Y-%m-%d %H:%M:%S'', startDate, ''unixepoch'', ''localtime'') AS start_date_local, strftime(''%Y-%m-%d %H:%M:%S'', endDate, ''unixepoch'', ''localtime'') AS end_date_local, sources FROM events WHERE cup = 1;\n\n* This query finds the biggest ties in any event. This a bit more complex query was devised by ChatGPT. The "result" column does not differentiate between time or apple count in this database, so we would need to manually cross-reference with another query to determine whether the ties are based on time or apple count, if desired. The record tie with the same time occured in the first World Cup event 8 where five kuskis shared a time of 25.12, resulting in a position of 47. This was actually already figured out by Xiphias with his python script ( https://discord.com/channels/207629806513160192/220952076266635264/1224008883459325963 ) that analyzed the original World Cup result text files. Here''s the SQL query for it in this database, showing the cup, event and tie count. Note: Line breaks can be added to the query for readability as demonstrated by some of the queries here. This same query can also be written as a single line.\n\n WITH ResultCounts AS (\n    SELECT cup, event, result, COUNT(*) AS count\n    FROM records\n    GROUP BY cup, event, result\n),\nMaxTies AS (\n    SELECT cup, event, MAX(count) AS max_tie_count\n    FROM ResultCounts\n    GROUP BY cup, event\n)\nSELECT cup, event, max_tie_count\n FROM MaxTies\n ORDER BY max_tie_count DESC;\n\n* Another complex query, made with the help of ChatGPT, displays data from the events table and includes the top 3 positions for each event from the records table.\n\nSELECT\n    e.id AS event_id,\n    e.cup,\n    e.event,\n    e.name AS event_name,\n    e.designers,\n    strftime(''%Y-%m-%d %H:%M:%S'', e.startDate, ''unixepoch'', ''localtime'') AS start_date_local,\n    strftime(''%Y-%m-%d %H:%M:%S'', e.endDate, ''unixepoch'', ''localtime'') AS end_date_local,\n    e.link,\n    e.notes AS event_notes,\n    e.apples,\n    e.killers,\n    e.gravity,\n    e.sources,\n    MAX(CASE WHEN r.position = 1 THEN r.nick END) AS first_place_nick,\n    MAX(CASE WHEN r.position = 2 THEN r.nick END) AS second_place_nick,\n    MAX(CASE WHEN r.position = 3 THEN r.nick END) AS third_place_nick\n FROM\n    events e\n JOIN\n    records r ON e.cup = r.cup AND e.event = r.event\n WHERE\n    r.position IN (1, 2, 3)\n GROUP BY\n    e.id, e.cup, e.event, e.name, e.designers, e.startDate, e.endDate, e.link, e.notes, e.apples, e.killers, e.gravity, e.sources\n ORDER BY\n    e.cup, e.event;\n\n* A query to list players with top 3 finishes in World Cup events. Tip: To list players with most event wins, we can modify the WHERE clause to `r.position IN (1)`.\n\nSELECT u.standard_nick AS nick, COUNT(*) AS event_podiums FROM records r JOIN users u ON u.id = r.user_id WHERE r.position IN (1, 2, 3) AND r.event != 999 GROUP BY nick ORDER BY event_podiums DESC;\n\n* A query to list the number of top 3 positions in the overall standings.\n\nSELECT u.standard_nick AS standardized_nick, COUNT(*) AS top3_count FROM records r JOIN users u ON u.id = r.user_id WHERE r.event = 999 AND r.position IN (1, 2, 3) GROUP BY r.user_id, u.standard_nick ORDER BY top3_count DESC;\n\n* A query to order players with most participations in World Cup events showing also the number of cups they have participated.\n\nSELECT (ROW_NUMBER() OVER (ORDER BY participations DESC)) AS "#", nick, participations, cups FROM (SELECT u.id AS user_id, u.standard_nick AS nick, COUNT(*) AS participations, COUNT(DISTINCT r.cup) AS cups FROM records r JOIN users u ON u.id = r.user_id WHERE r.event != 999 GROUP BY u.id, u.standard_nick) ORDER BY participations DESC;\n\nCredits\n-------\n\nThe data in this database has been compiled from various sources. Credits are as follows:\n\n- Moposite archives: px, Abula\n- Moposite news: px, Abula\n- IRC log files: Abula\n- elma.online / wcup.site: Kopaka, ramone, Markku, jaws, danitah, Xarthok, roope, Labs \n- Substantial nick merging info for the users table: Arzenik, Markku\n\nLicense\n-------\n\nTo the extent possible under law, onla has waived all copyright and related or neighboring rights to this work. This work is published from: Finland.\n\nThis work is licensed under the Creative Commons Zero (CC0) 1.0 Universal Public Domain Dedication.\nTo view a copy of this license, visit https://creativecommons.org/publicdomain/zero/1.0/.\n','\n',char(10)));
