INSERT INTO cups VALUES(5,15,1115024400,1123578000,'px',replace('2nd May 2005 mn: `Remember, in order to submit your times, you need to have an active Mopolauta account. Also remember to read carefully through the cup info >>` `There''s no timelimit for the first event, just be sure that your time is within the replay limit (5min). ` More information on World Cup 5 at https://old.moposite.com/contests_world_cups_5.php https://moposite.com/news.php?from=01-01-2005&to=31-12-2005&page=4\n\nSource for the event start times and deadlines in the fifth World Cup from https://moposite.com/contests_world_cups.php\n\n9th May 2005 mn: `The 3rd event will be divided into two parts (a and b). You can play only either one, not both.See the planned schedule (might yet change) and don''t hesitate to ask, if you have questions >>` https://moposite.com/news.php?from=01-01-2005&to=31-12-2005&page=4\n\n10th Jul 2005 mn: `The 12th event, by MP, is a special event. You need to pick whichever 16 apples and finish the level normally. That means, you can skip up to 17 apples >>` https://moposite.com/news.php?from=01-01-2005&to=31-12-2005&page=3','\n',char(10)));
INSERT INTO cups VALUES(6,15,1378054800,1387123200,replace('Xarthok, Kopaka, Ville_J, px, ramone\n','\n',char(10)),replace('6.wcup.site/rules: `There will be 15 events in the cup of which only your 14 best results will count towards your total points. Every Sunday for 15 weeks from September 1 until December 15 at 20:00 EEST a new event will start in a completely new level. You can download it from the Events section. You will have time until the following Sunday 18:00 EEST to play the level and submit your best result (.rec file) on http://elmaonline.net/statistics/cups/4 Results of each event are announced live in #wc6 on IRCnet at 19:00 EEST and on the websites after that`\n\nSource for the event start times and deadlines in the sixth World Cup from https://6.wcup.site/events\n\n6.wcup.site/blog: The crew behind the cup: Xarthok, Kopaka, Ville_J, px, ramone','\n',char(10)));
INSERT INTO cups VALUES(7,15,1487534400,1495386000,replace('ramone, me, roope, kopa, jaws, ?\n','\n',char(10)),replace('7.wcup.site: `It is required that you are connected to the server in order to get into the results. One skip is allowed, meaning that only your 14 best results will count towards your total points. Results of each event are announced live in #wc7 on IRCnet and on the websites after that. More information about the rules can be found at https://7.wcup.site/\n\nSource for the event start times and deadlines in the seventh World Cup from https://7.wcup.site/events','\n',char(10)));
