INSERT INTO events VALUES(31,3,1.0,'WCup3 01 Made By RiZ','RiZ',962042400,962528400,NULL,'Timelimit: 36.20. Textures: FUCK',NULL,NULL,NULL,replace('26th Jun 2000 irclogs: `[18:14] <Karlis_FM> 8-9 aikaa?!?!?`\n#across2000-2000.log: 100518gg. The Wcup 3 started on monday 26th Jun 2000 between 20:00 and 21:00. Abula''s irclog sessions missing the time between 19:23-22:50 EEST. \n26th Jun 2000 18:00 UTC mn: `The 3rd World Cup has finally started, so go get the level, read the rules very well and höylä like hell. The replays must be sent by 12:00 EET 2nd July to wcup@moposite.com.`\n28th Jun 2000 mn: `First of all, the timelimit for the first WCup3 level is 36,20.` https://moposite.com/news.php?from=01-01-2000&to=31-12-2000&page=7','\n',char(10)));
