PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "records" (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    cup INTEGER,
    event REAL,
    position INTEGER,
    nick TEXT,
    team TEXT,
    nat TEXT,
    result REAL,
    points REAL
, notes TEXT, user_id INTEGER);
CREATE TABLE cups (
    cup INTEGER PRIMARY KEY,
    events INTEGER,
    startDate INTEGER,
    endDate INTEGER,
    organizers TEXT,
    information TEXT
);
CREATE TABLE events (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    cup INTEGER,
    event REAL,
    name TEXT,
    designers TEXT,
    startDate INTEGER,
    endDate INTEGER,
    link TEXT,
    notes TEXT,
    apples INTEGER,
    killers INTEGER,
    gravity INTEGER,
    sources TEXT,
    FOREIGN KEY(cup) REFERENCES cups(cup)
);
CREATE TABLE users (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    standard_nick TEXT
, eol_id INTEGER);
DELETE FROM sqlite_sequence;
COMMIT;

